import React, { Component } from 'react'

class NewClient extends Component {
    state = {
        name: '',
        email:'',
        vechicle:'',
        servicesRequired:
        {
         tireRotation: "",
         oilChange: "",
         wheelAlign: "",
         brakePad: ""
         }
        
     }

     addUser = (e) => {
         console.log(this.state)
         this.props.addUser(this.state);
     }

    render() {
     
        return(
            <div className="container">   
            <div className="row">
            <form onSubmit={(e) => this.addUser(e)}>
                <div className="form-group">
                <label htmlFor="">Name:</label>
                <input type="text" 
                    className="form-control"
                    value={this.state.name}
                    onChange={(e) => this.setState({ name: e.target.value })}
                    />
                </div>


                <div>
                    <label htmlFor="">email:</label>
                    <input type="email" className="form-control"
                        value={this.state.email}
                        onChange={(e) => this.setState({ email: e.target.value })} />
                </div>

                <div>
                    <label htmlFor="">vechicle:</label>
                    <input type="text" className="form-control"
                        value={this.state.vechicle}
                        onChange={(e) => this.setState({ vechicle: e.target.value })} />

                </div>
                <div>
                    <label htmlFor="">Services:</label>
                    <input type="date" className="form-control"
                        value={this.state.tireRotation}
                        placeholder="Tire Rotaton"
                        onChange={(e) => this.setState({ tireRotation: e.target.value })} />

                        <input type="date" className="form-control"
                        value={this.state.oilChange}
                        placeholder="Oil Change"
                        onChange={(e) => this.setState({ oilChange: e.target.value })} 
                        />

                        <input type="date" className="form-control"
                        value={this.state.wheelAlign}
                        placeholder="Wheel alignment"
                        onChange={(e) => this.setState({ wheelAlign: e.target.value })} />

                        <input type="date" className="form-control"
                        value={this.state.brakePad}
                        placeholder="Brake service"
                        onChange={(e) => this.setState({ brakePad: e.target.value })} 
                        />
                </div>

                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
            </div>    
            </div>
        )
    }
}

export default NewClient;
